import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <ul>
        {/* General Links */}
        <li><Link to="/">Home</Link></li>
        <li><Link to="/products">Products</Link></li>

        {/* Product Management Links */}
        <li><Link to="/products/create">Create Product</Link></li>
        <li><Link to="/products/update/1">Update Product</Link></li> {/* Example ID */}
        <li><Link to="/products/delete/1">Delete Product</Link></li> {/* Example ID */} 

        {/* User Links */}
        <li><Link to="/signup">Sign Up</Link></li>
        <li><Link to="/signin">Sign In</Link></li>

        {/* âœ… New: User Center */}
        <li><Link to="/profile">My Profile</Link></li>
        <li>
              <button onClick={handleSignOut} style={{ cursor: 'pointer' }}>
                Sign Out
              </button>
            </li>
      </ul>
    </nav>
  );
}

export default Navbar;
